Обратился в с заявлением и всеми необходимыми документами для восстановления паспорта,по месту жительства в тп №75 ОУФМС РФ поС-Пб и ЛО,про время ожидания,вежливость,комфортность и доступность,говорить не приходиться.Люди для сотрудников частности(старшего инспектора)-просто челядь которая осмелилась к ним обратиться.На моих глазах инспектор орала на бабулю которая не могла самостоятельно заполнить заявление об утере,послала ее из кабинета,хотя по закону-"если гражданин по состоянию здоровья или других причин не в состоянии самостоятельно заполнить заявление,-заполняет инспектор.Ко всему выше изложенному нарушают сроки оказания услуги на свое усмотрение.Срок оказания государственной услуги по выдаче паспорта гражданина Российской Федерации взамен утраченного (похищенного):

    10 дней по месту жительства;
    2-х месяцев по месту пребывания или по месту обращения._цитата с официального сайта УФМС по С-Пб и ЛО.Повторюсь обращался по месту жительства,все равно 2 месяца.Быстро инспектор пообещала сделать только Осетину обратившемуся передо мной,ничуть меня не смутившись с удовольствием разглядывая бутылку дорогого  шампанского и коробку конфет.Т.е сделать утерянный паспорт с запросом в Осетию быстрее чем мне по месту жительства.

